#include <stdio.h>
#include <time.h>
int maxsubSequenceSum1(int arr[], int n)
{
  int maxNum = 0;
  for (int i = 0; i < n; i++)
  {
    for (int j = i; j < n; j++)
    {
      int currentNum = 0;
      for (int k = i; k <= j; k++)
      {
        currentNum += arr[k];
      }
      if (maxNum < currentNum)
      {
        maxNum = currentNum;
      }
    }
  }
  return maxNum;
}
